import Chat from "./Chat";

export default function ChatContainer({chats}) {
    return (chats.map((chat) => {
        const loggedUser = localStorage.getItem("user");
        <Chat chat={chat} key={chat._id} loggedUser={loggedUser}></Chat>
    }))
}
